import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import {ClientTable, Event} from 'vue-tables-2';

Vue.config.productionTip = false

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')

Vue.use(ClientTable);
